  faCoffee
} from '@fortawesome/free-solid-svg-icons'
import {
  CardGroup
} from 'react-bootstrap';



function CardMoney() {
  return ( 
  <CardGroup >
    <Card style = {
      {
        width: '18rem'
      }
    } >
    <Card.Body >
    <Card.Title > Paypal < /Card.Title> <
    Card.Text >
    <FontAwesomeIcon icon = {
      faCoffee
