    /Card> <
    Card style = {
      {
        width: '18rem'
      }
    } >
    <
    Card.Body >
    <
    Card.Title > Paypal < /Card.Title> <
    Card.Text >
    <
    FontAwesomeIcon icon = {
      faCoffee
    }
    /> <
    /Card.Text> <
    /Card.Body> <
    /Card> <
    Card style = {
      {
        width: '18rem',
        height: '18rem'
      }
